// client/src/components/Dashboard.js
import React from 'react';

const Dashboard = () => {
  return (
    <div>
      <h2>Financial Dashboard</h2>
      <p>Overview of your finances will go here (analytics and charts).</p>
    </div>
  );
};

export default Dashboard;
